import React from 'react';
import './zkInk.css';  // Import the corresponding CSS

function ZkInk() {
  return (
    <div className="zk-ink-container">
      <div className="zk-ink-image">
        <img src="/images/zk-ink.jpg" alt="ZK Ink" />
      </div>
      <div className="zk-ink-description">
        <h2>ZK Ink</h2>
        <p>ZK Ink is a renowned manufacturer and supplier of high-quality printing inks for a wide range of packaging applications. We focus on creating durable, vibrant, and environmentally-friendly ink solutions that cater to various industries and client needs.</p>
      </div>
    </div>
  );
}

export default ZkInk;
